<?php 
namespace App\Http\Controllers;

use Illuminate\Http\Request;
use Barryvdh\Snappy\Facades\SnappyPdf;

class PDFController extends Controller
{
    public function generatePDF()
    {
        $img = 'data:image/png;base64,';
        $pdf = SnappyPdf::loadView('welcome', compact('img'))
        ->setOption('orientation', 'Portrait')  // Portrait mode
        ->setOption('page-size', 'A4')          // A4 paper size
        ->setOption('lowquality', false)         // Low quality (for smaller size)
        ->setOption('disable-smart-shrinking', true)
        ->setOption('enable-local-file-access', true)  // Prevent shrinking the page
        ->setOption('margin-top', 0)           // Remove top margin
        ->setOption('margin-bottom', 0)        // Remove bottom margin
        ->setOption('margin-left', 0)          // Remove left margin
        ->setOption('margin-right', 0);        // Remove right margin
    
        // Save the PDF to the 'public/assets/' directory
        $pdf->save(public_path('assets/contract2.pdf'));
        
        return response()->json(['message' => 'PDF saved successfully!']);
    }
}
